fun uniquePathsWithObstacles(paths: IntArray): Int {
    val n = paths.size
    val dp = Array(n) { IntArray(n) { 0 } }
    dp[0][0] = 1

    for (i in 1 until n) {
        for (j in 1 until n) {
            if (paths[i - 1] == 0 && paths[j - 1] == 0) {
                dp[i][j] = dp[i - 1][j - 1] + dp[i - 1][j]
            } else if (paths[i - 1] == 0) {
                dp[i][j] = dp[i - 1][j]
            } else if (paths[j - 1] == 0) {
                dp[i][j] = dp[i][j - 1]
            } else {
                dp[i][j] = dp[i - 1][j - 1] + dp[i - 1][j]
            }
        }
    }

    return dp[n - 1][n - 1]
}

