class Problem2064 {
    fun minimizedMaximum(a: Int, b: IntArray): Int {
        val quantities = b.map { it.toString() }
        val quantitiesList = quantities.toTypedArray()
        val result = findMinimizedMaximum(quantitiesList)
        return result
    }

    private fun findMinimizedMaximum(quantities: Array<String>): Int {
        val max = quantities.maxOrNull() ?: 0
        val min = quantities.minOrNull() ?: 0
        return Math.max(max, min)
    }
}

